import React from 'react';
import {Routes, Route} from 'react-router-dom';
import Home from './routes/home/home.component';

const App = () => {  
  return (  
    <Routes>
      <Route path='/' component={Home}/>
      <Home/>
    </Routes>
  );
}

export default App;
